import styled from 'styled-components';
import Responsive from './Responsive';
import Button from './Button';
import { Link } from 'react-router-dom';

const NavBlock = styled.div`
position: fixed;
height: 100%;  
width: 12rem;
background: #BCF5A9;
box-shadow: 0px 4px 2px rgba(0, 0, 0, 0.08);


`;
const Wrapper = styled.ul`
margin:0;

font-weight: 600;
list-style:none;
width:100%;
padding-left:0;
padding-top: 1rem;

 
`;

const Menu = styled.li`
padding: 15px;
font-size: 1.2rem;
color:#6E6E6E;
display: normal;
width:100%;
&:hover{
  background:#58FA58;
}
&:active{
  background:#;
}

`
const Spacer = styled.nav`


`;

const Nav = () => {
    return (
        <>
        <NavBlock>
            <Wrapper>
              <Menu>게시판</Menu>
              <Menu>모임</Menu>
              <Menu>미션&amp;식물</Menu>
              <Menu>메뉴</Menu>
              
           </Wrapper>
        </NavBlock>
        <Spacer/>
        
        </>
    );
};

export default Nav;
